import React from 'react';

import { Switch, Link } from 'react-router-dom';
import { render } from '@testing-library/react';


class Navbar extends React.Component{
    render(){
        return(
            <nav id="menu" >
                <ul>
                    <a class="menu-links" data-menuanchor="about" onClick={()=> history.push("/Portfolio")}>About</a>
                    <a class="menu-links" data-menuanchor="work" onClick={()=> history.push("/Projects")}>Work and Code</a>
                    <a class="menu-links" data-menuanchor="contact" href="#contact">Contact</a>
                </ul>
            </nav>
        )
    }
}
export default Navbar
